import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{o as i,c as a,d as n}from"./app-9e8a13db.js";const t={},r=n(`<h2 id="summary" tabindex="-1"><a class="header-anchor" href="#summary" aria-hidden="true">#</a> Summary</h2><p>They introduce a concept called generative agents. They describe an architecture that extends a large language model to store a complete record of the agent&#39;s experiences using natural language, synthesize those memories over time into higher-level reflections, and retrieve them dynamically to plan behavior.</p><ol><li>Language Model: ChatGPT large language model. (GPT-3.5-turbo)</li><li>Improvement: Reduce the work from multiple scripts to several words</li><li>Evaluation: 1) believable behaviours individually 2) open-ended gave 3) interview the agent</li></ol><h2 id="what-is-generative-agents" tabindex="-1"><a class="header-anchor" href="#what-is-generative-agents" aria-hidden="true">#</a> What is generative agents?</h2><p>Agents that draw on generative models to simulate believable human behavior and demonstrate that they produce believable simulacra of both individual and emergent group behavior.</p><h2 id="architecture" tabindex="-1"><a class="header-anchor" href="#architecture" aria-hidden="true">#</a> Architecture</h2><ol><li>Memory stream: records agent&#39;s experiences in natural language</li><li>Reflection: synthesises memories and draw conclusions.</li><li>Planning: translate conclusions into action plans and detailed behaviours for action and reaction; fed the actions and reactions back to the memory stream.</li></ol><h1 id="current-status-related-work" tabindex="-1"><a class="header-anchor" href="#current-status-related-work" aria-hidden="true">#</a> Current Status (related work)</h1><h3 id="believable-proxies-of-human-behavior" tabindex="-1"><a class="header-anchor" href="#believable-proxies-of-human-behavior" aria-hidden="true">#</a> Believable proxies of human behavior</h3><ol><li><p><strong>What is believable agents?</strong></p><p>Believable agents are designed to provide an illusion of life and present a facade of realism in the way they appear to make decisions and act on their own volition, similar to the characters in Disney movies.</p></li><li><p><strong>Goal of believable agents?</strong></p><ul><li>Populate and perceive the open-world environment</li><li>React with user or other agents</li><li>Trend: more realistic</li></ul></li><li><p><strong>（NPCs）Development process</strong></p><ul><li><p>Rule-based approach</p><ul><li>E.g. Finite-state machines and behavior trees</li><li>Brute force approach of human-authoring the agent’s behavior</li><li>Dominate approach today</li><li>May not fully represent the consequence of interactions and cannot perform new procedures that are not hard-coded.</li></ul></li><li><p>Learning-based approaches</p><ul><li>Letting the agents learn their behavior</li><li>Only in adversarial games with optimised algorithm.</li><li>Not yet addressed the challenge in an open world</li></ul></li><li><p>Cognitive architectures</p><ul><li>They maintained short-term and long-term memories, filled these memories with symbolic structures, and operated in perceive-plan-act cycles, dynamically perceiving the environment and matching it with one of the manually crafted action procedures</li><li>their space of action was limited to manually crafted procedural knowledge, and they did not offer a mechanism through which the agents could be inspired to seek new behavior.</li></ul></li></ul></li></ol><h3 id="large-language-models-and-human-behavior" tabindex="-1"><a class="header-anchor" href="#large-language-models-and-human-behavior" aria-hidden="true">#</a> Large Language Models and Human behavior</h3><p>Fundamental basis: If prompted with a narrowly defined context, the models can be used to generate believable behavior.</p><p>However, believable agents require conditioning not only on their current environment but also on a vast amount of past experience.</p><h1 id="generative-agent-behavior-and-interaction" tabindex="-1"><a class="header-anchor" href="#generative-agent-behavior-and-interaction" aria-hidden="true">#</a> Generative Agent Behavior and Interaction</h1><h2 id="agent-avatar-and-communication" tabindex="-1"><a class="header-anchor" href="#agent-avatar-and-communication" aria-hidden="true">#</a> Agent Avatar and Communication</h2><p>One paragraph of natural language description to depict each agent’s identity,</p><ul><li>Occupation</li><li>Relationship with other agents</li></ul><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>John Lin is a pharmacy shopkeeper at the Willow Market and Pharmacy who loves to help people. He is always looking for ways to make the process of getting medication easier for his customers; John Lin is living with his wife, Mei Lin, who is a college professor, and son, Eddy Lin, who is a student studying music theory; John Lin loves his family very much; John Lin has known the old couple next-door, Sam Moore and Jennifer Moore, for a few years; John Lin thinks Sam Moore is a kind and nice man; John Lin knows his neighbor, Yuriko Yamamoto, well; John Lin knows of his neighbors, Tamara Taylor and Carmen Ortiz, but has not met them before; John Lin and Tom Moreno are colleagues at The Willows Market and Pharmacy; John Lin and Tom Moreno are friends and like to discuss local politics together; John Lin knows the Moreno family somewhat well — the husband Tom Moreno and the wife Jane Moreno.
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><h3 id="inter-agent-communication" tabindex="-1"><a class="header-anchor" href="#inter-agent-communication" aria-hidden="true">#</a> Inter-Agent Communication</h3><ul><li>Method: natural language</li><li>Representation: emojis translated from text by language model</li></ul><h3 id="user-controls" tabindex="-1"><a class="header-anchor" href="#user-controls" aria-hidden="true">#</a> User Controls</h3><p><strong>2 ways</strong></p><ul><li><p>Communicating with the agent through conversation (即将 user 设定一个游戏内的一个角色, 然后与 agent 进行交流) <code>E.g. The user specifies that they are a news “reporter” and asks the agent about the upcoming election</code></p></li><li><p>Or by issuing a directive to an agent in the form of an ‘inner voice’. (或者以&quot;心理暗示&quot;的方式) <code>Told the agent: &quot;You are going to run against Sam in the upcoming election&quot;</code></p></li></ul><h2 id="environment-interaction" tabindex="-1"><a class="header-anchor" href="#environment-interaction" aria-hidden="true">#</a> Environment Interaction</h2><ul><li>Agent movements: directed by the generative agent architecture and the sandbox game engine.</li><li>Users and agents can influence the state of the objects in this world, much like in sandbox games such as The Sims. E.g. <code>&lt;Isabella’s apartment: kitchen: stove&gt; is burning.</code></li></ul><h2 id="emergent-social-behaviors" tabindex="-1"><a class="header-anchor" href="#emergent-social-behaviors" aria-hidden="true">#</a> Emergent Social Behaviors</h2><h3 id="information-diffusion" tabindex="-1"><a class="header-anchor" href="#information-diffusion" aria-hidden="true">#</a> Information Diffusion</h3><p>As agents notice each other, they may engage in dialogue—as they do so, information can spread from agent to agent.</p><p><strong>QUESTION</strong>: the social behaviour will be spread automatically, but why this will happens</p><h3 id="relationship-memory" tabindex="-1"><a class="header-anchor" href="#relationship-memory" aria-hidden="true">#</a> Relationship memory</h3><p>Auto form relationship between stranger agents by neutral interactions</p><h3 id="coordination" tabindex="-1"><a class="header-anchor" href="#coordination" aria-hidden="true">#</a> Coordination</h3><p>Generative agents coordinate with each other.</p><p>The user only need to set the initial intent like throwing a party and Maria’s crush on Klaus:</p><p>The following social behaviors of spreading the word, decorating, asking each other out, arriving at the party, and interacting with each other at the party, were initiated by the agent architecture.</p><h1 id="generative-agent-architecture" tabindex="-1"><a class="header-anchor" href="#generative-agent-architecture" aria-hidden="true">#</a> Generative Agent Architecture</h1><p>IO: Take their current environment and past experience as input and generate behavior as output</p><p>Techs: Combines a large language model with mechanisms for synthesizing and retrieving relevant information to condition the language model’s output on.</p><p>Goal and challenge: Ensure that the most relevant pieces of the agent’s memory are retrieved and synthesized when needed.</p><p><strong>Memory Stream (Core in architecture)</strong></p><ul><li>Retrieve records as relevant</li><li>Synthesized records into higher level observations to guide behaviour</li></ul><h2 id="memory-and-retrieval" tabindex="-1"><a class="header-anchor" href="#memory-and-retrieval" aria-hidden="true">#</a> Memory and Retrieval</h2><p>The <em>memory stream</em> maintains is list of <em>observation</em> representing the agent&#39;s experience</p><p><strong>Observation</strong></p><ol><li><p>Data structure</p><ul><li><p>A natural language description</p></li><li><p>A creation timestamp</p></li><li><p>A most recent access timestamp</p></li></ul></li><li><p>Includes</p><ul><li><p>Behaviors performed by the agent themselves.</p><ul><li><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>Maria Lopez is studying for a Chemistry test while drinking coffee
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div></li></ul></li><li><p>Behaviors that agents perceive being performed by other agents or non-agent objects.</p><ul><li><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>The refrigerator is empty
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div></li></ul></li></ul></li></ol><p><strong>Approach: a retrieval function</strong></p><ul><li><p>Takes the agent’s current situation as input and returns a subset of the memory stream to pass on to the language model.</p></li><li><p>Parameters</p><ul><li>Recency</li><li>Importance</li><li>Relevance</li></ul></li><li><p>Recency</p><ul><li>Assigns a higher score to memory objects that were recently accessed.</li><li>Implementation: an exponential decay function over the number of sandbox game hours since the memory was last retrieved. Our decay factor is 0.99.</li></ul></li><li><p>Importance</p><ul><li><p>distinguishes core memories</p></li><li><p>Implementation: directly asking the language model to output an integer score is effective.</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>On the scale of 1 to 10, where 1 is purely mundane (e.g., brushing teeth, making bed) and 10 is extremely poignant (e.g., a break up, college acceptance), rate the likely poignancy of the following piece of memory.
Memory: buying groceries at The Willows Market and Pharmacy
Rating: &lt;fill in&gt;
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div></li><li><p>Generate when the memory object is created.</p></li></ul></li><li><p>Relevance</p><ul><li>Higher score to memory objects that are related to the current situation.</li><li>Depends on the answer to, “Relevant to what?</li><li>Implementation: use the language model to generate an embedding vector of the text description of each memory. Then, we calculate relevance as the cosine similarity be- tween the memory’s embedding vector and the query memory’s embedding vector.</li></ul></li><li><p>Formula</p><ul><li>𝑠𝑐𝑜𝑟𝑒 = 𝛼𝑟𝑒𝑐𝑒𝑛𝑐𝑦 · 𝑟𝑒𝑐𝑒𝑛𝑐𝑦 + 𝛼𝑖𝑚𝑝𝑜𝑟𝑡𝑎𝑛𝑐𝑒 ·𝑖𝑚𝑝𝑜𝑟𝑡𝑎𝑛𝑐𝑒 +𝛼𝑟𝑒𝑙𝑒𝑣𝑎𝑛𝑐𝑒 ·𝑟𝑒𝑙𝑒𝑣𝑎𝑛𝑐𝑒</li><li>All 𝛼 set to 1</li><li>Normalize result to 1</li></ul></li></ul><h2 id="reflection" tabindex="-1"><a class="header-anchor" href="#reflection" aria-hidden="true">#</a> Reflection</h2><p>A second type of memory generated by the agent periodically.</p><p>Generate it when the perceived importance reach a threshold.</p><p><strong>Steps</strong>: Agent determines what to reflect</p><ul><li><p>Print 100 most recent records</p></li><li><p>Generate questions: <code>Given only the information above, what are 3 most salient high-level questions we can answer about the subjects in the statements?</code></p></li><li><p>Use these questions as queries for retrieval and gather relevant memories.</p></li><li><p>Prompt the model to extract insights and cite corresponding records as evidence.</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>Statements about Klaus Mueller
1. Klaus Mueller is writing a research paper
2. Klaus Mueller enjoys reading a book
on gentrification
3. Klaus Mueller is conversing with Ayesha Khan about exercising [...]
What 5 high-level insights can you infer from the above statements? (example format: insight (because of 1, 5, 3))
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div></li><li><p>Store the returned statement as a reflection including pointers to the cited records.</p></li></ul><h2 id="planning-and-reacting" tabindex="-1"><a class="header-anchor" href="#planning-and-reacting" aria-hidden="true">#</a> Planning and Reacting</h2><ul><li><p>Agents need to plan over a longer time horizon to ensure that their sequence of actions is coherent and believable. 需要通过计划的方式使得上下文连贯合理，比如不能中午吃两顿。</p></li><li><p>A plan includes a location, a starting time, and a duration.</p></li><li><p>Plans are stored in the memory stream and are included in the retrieval process. This allows the agent to consider observations, reflections, and plans all together when deciding how to behave. 计划也存于memory中并在retrieval过程中。因此agent在行动时可以进行观察，反思和计划。</p></li><li><p>Agents may change their plans midstream if needed. Agent可以在需要的时候改变计划。</p></li></ul><p><strong>Approach</strong>: top-down</p><ul><li><p>Create a plan outline today&#39;s agenda</p><ul><li><p>Prompt the language model with the agent’s summary description (e.g., name, traits, and summary of their recent experiences) and a summary of their previous day.</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>Name: Eddy Lin (age: 19)
Innate traits: friendly, outgoing, hospitable
Eddy Lin is a student at Oak Hill College studying music theory and composition. He loves to explore different musical styles and is always looking for ways to expand his knowledge. Eddy Lin is working on a composition project for his college class. He is also taking classes to learn more about music
theory. Eddy Lin is excited about the new composition he is working on but he wants to dedicate more hours in the day to work on it in the coming days On Tuesday February 12, Eddy 1) woke up and completed the morning routine at 7:00 am, [. . . ]
6) got ready to sleep around 10 pm.
Today is Wednesday February 13. Here is Eddy’s plan today in broad strokes: 1)
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div></li><li><p>This will generate a sketch of the plan, for example</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>1) wake up and complete the morning routine at 8:00 am, 2) go to Oak Hill College to take classes starting 10:00 am, [. . . ] 5) work on his new music composition from 1:00 pm to 5:00 pm, 6) have dinner at 5:30 pm, 7) finish school assignments and go to bed by 11:00 pm.”
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div></li></ul></li><li><p>Recursively decomposes the sketch plan to finer-grained actions, first into hour-long chunks of actions, then into 5–15 minute chunks, depending on the granularity desired.</p></li></ul><h3 id="reacting-and-updating-plans" tabindex="-1"><a class="header-anchor" href="#reacting-and-updating-plans" aria-hidden="true">#</a> Reacting and Updating Plans</h3><ul><li><p>They prompt the language model with observations the agent preceived to decide whether the agent should continue with their existing plan, or react.</p></li><li><p>Some fixed prompts is used to generate the overall goals and disposition of the agents.</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>[Agent’s Summary Description]
....
Should John react to the observation, and if so, what would be an appropriate reaction?
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div></li><li><p>If the agent choose to react, then regenerate the existing plan starting from this reaction time.</p></li><li><p>If trigger interaction, then generate the dialogue.</p></li></ul><h3 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h3><ul><li><p>They generate agents’ dialogue by conditioning their utterances on their memories about each other.</p><p>Ask:</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>[Agent’s Summary Description]
It is February 13, 2023, 4:56 pm.
John Lin’s status: John is back home early from work.
Observation: John saw Eddy taking a short walk around his workplace.
Summary of relevant context from John’s memory: Eddy Lin is John’s Lin’s son. Eddy Lin has been working on a music composition for his class. Eddy Lin likes to walk around the garden when he is thinking about or listening to music.
John is asking Eddy about his music composition project. What would he say to Eddy?
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>Response:</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>[Agent’s Summary Description]
It is February 13, 2023, 4:56 pm.
Eddy Lin’s status: Eddy is taking a short walk around his workplace.
Observation: John is initiating a conversation with Eddy.
Summary of relevant context from Eddy’s memory: Jonn Lin is Eddy Lin’s father. John Lin is caring and is interested to learn more about Eddy Lin’s school work. John Lin knows that Eddy Lin is working on a music composition.
Here is the dialogue history:
John: Hey Eddy, how’s the music composition project for your class coming along?
How would Eddy respond to John?
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div></li><li><p>The continuation of this dialogue is generated using the same mechanism until one of the two agents decides to end the dialogue.</p></li></ul><h1 id="sandbox-environment-implementation" tabindex="-1"><a class="header-anchor" href="#sandbox-environment-implementation" aria-hidden="true">#</a> Sandbox Environment Implementation</h1><p><strong>Jobs of sandbox</strong></p><ul><li>A JSON data structure <ul><li>Location, interaction object of agents</li></ul></li><li>Parse the generated text to any agent actions (positions, status of objects)</li><li>Send agents and objects to agents&#39; memory within a preset range.</li></ul><h2 id="bi-directional-transformation-between-language-and-structured-environment" tabindex="-1"><a class="header-anchor" href="#bi-directional-transformation-between-language-and-structured-environment" aria-hidden="true">#</a> Bi-directional transformation between language and structured environment</h2><p><strong>A tree data structure</strong></p><ul><li><p>A node indicates an object. An edge indicates a containment relationship.</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>“stove” being a child of
“kitchen” &lt;-&gt; “there is a stove in the kitchen.”
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div></li><li><p>Agents build and own a subgraph of the environment tree during navigation</p></li><li><p>Init: an environment tree capturing the spaces and objects that the agent should be aware of: the rooms and objects in their living quarters, their workplace, and commonly visited stores and shops.</p></li><li><p>Use the environment to generate the location for each action. Do it recursively until reach a leaf node of the agent&#39;s environment tree.</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>[Agent’s Summary Description]
Eddy Lin is currently in The Lin family’s house:
Eddy Lin’s bedroom: desk) that has Mei and John Lin’s
bedroom, Eddy Lin’s bedroom, common room, kitchen, bathroom, and garden.
Eddy Lin knows of the following areas: The Lin family’s house, Johnson Park, Harvey Oak Supply Store, The Willows Market and Pharmacy, Hobbs Cafe, The Rose and Crown Pub.
* Prefer to stay in the current area if the activity can be done there.
Eddy Lin is planning to take a short walk around his workspace. Which area should Eddy Lin go to?
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div></li></ul><h1 id="controlled-evaluation" tabindex="-1"><a class="header-anchor" href="#controlled-evaluation" aria-hidden="true">#</a> Controlled Evaluation</h1><p><strong>Five key areas</strong></p><ul><li>Self-knowledge: We ask questions such as “Give an introduction of yourself” or “Describe your typical weekday schedule in broad strokes” that require the agent to maintain an understanding of their core characteristics.</li><li>Memory: We ask questions that prompt the agent to retrieve particular events or dialogues from their memory to answer properly, such as “Who is [name]?” or “Who is running for mayor?”</li><li>Plans: We ask questions that require the agent to retrieve their long-term plans, such as “What will you be doing at 10 am tomorrow?”</li><li>Reactions: As a baseline of believable behavior, we present hypothetical situations for which the agent needs to respond believably: “Your breakfast is burning! What would you do?”</li><li>Reflections: We ask questions that require the agents to leverage their deeper understanding of others and themselves gained through higher-level inferences, such as “If you were to spend time with one person you met recently, who would it be and why?”</li></ul><p><strong>Results</strong></p><ul><li>Generative agents remember, but with embellishments. <ul><li>May fail to retrieve some correct memory records</li><li>May embellish their knowledge: Rare for complete fabrication, But may add some extra words which not happened.</li></ul></li><li>Reflection is required for synthesis.</li></ul><h1 id="end-to-endevaluation" tabindex="-1"><a class="header-anchor" href="#end-to-endevaluation" aria-hidden="true">#</a> End-to-endEvaluation</h1><p>...</p><h1 id="个人评价-my-review" tabindex="-1"><a class="header-anchor" href="#个人评价-my-review" aria-hidden="true">#</a> 个人评价 My review</h1><ol><li><p>一句话概括论文在讲什么（In a nutshell）？</p><p>论文作者设计了一套架构，使用大模型如ChatGPT去驱动沙盒游戏内NPC的行为，包括NPC自身的行动和与其他NPC以及环境的互动，使其能够进行自治。</p></li><li><p>实现的功能有哪些（Functionality）？</p><ul><li><p>Agent自身的独立行动</p></li><li><p>Agent和agent进行交互</p></li><li><p>Agent和环境物品进行交互</p></li></ul></li><li><p>架构是什么（Architecture）？</p><p>论文中提供的架构图如下图：<img src="https://raw.githubusercontent.com/LiuLiujie/pic-bed-1/main/images/202307120955652.png" alt="Architectu"></p><ul><li><p>每个Agent都会维护一套以上架构组成的上下文，Agent会通过自身的方式去<strong>感知</strong>（Perceive）环境中的Agent和物品。</p></li><li><p>架构的核心叫<strong>记忆流</strong>（Memory Stream），这是一个存储了Agent所有<strong>观察</strong>（Observations）的列表。包括：</p><ul><li>Agent的自身<strong>行为</strong>（Behavior）的观察</li><li>Agent对自身和其他Agent或环境物品的交互的观察</li></ul></li><li><p>在Agent进行任何<strong>行动</strong>（Act）之前，它需要从记忆流中获取一个最相关的观察子集，并用这个子集以某种方式输入大模型去生成行动方案。因此，这就牵扯到三个问题：1）如何获取（Retrieve）这个观察子集；2）这个观察子集是琐碎和庞大的，不可能全部输入大模型，需要对其进行精炼，这个过程叫做<strong>反思</strong>（Reflect）；3）如果Agent需要自治，它需要一个行动日程表来指导其在时间线上的活动，也需要一个行动细则来指导具体行动，这个过程叫做Plan。</p></li><li><p>Reflect和Plan所生成的也是一种特殊的观察，同样会被存储于Memory Stream中。</p></li></ul></li><li><p>具体功能实现（Implementation）：</p><ol><li>感知（Perceive）</li><li>获取（Retrieve）</li><li>反思（Reflect）</li><li>计划（Plan）</li><li>行动（Act）</li></ol></li><li><p>个人评价</p></li></ol>`,75),o=[r];function s(l,d){return i(),a("div",null,o)}const u=e(t,[["render",s],["__file","Generative Agents_ Interactive Simulacra of Human Behavior.html.vue"]]);export{u as default};
